import React from "react";

function Component() {
  return (
    <div className="formContainer">
      <div>
        <label htmlFor="email">Email</label>
        <input className="inputs" type="email" id="email" required />
      </div>
      <div>
        <label htmlFor="password">Password</label>
        <input className="inputs" type="password" id="password" required />
      </div>
      <div>
        <label htmlFor="passwords">Confirm Password</label>
        <input className="inputs" type="password" id="passwords" required />
      </div>
      <button id="signupButton">Sign Up</button>
    </div>
  );
}

export default Component;
